description:
A .pdf aiming to give simplified information for fresh drummers. 

Good for recognising the symbol on paper and which instrument to hit.

Very helpful for those who want some advanced theory, too.

Although copy-pasted, I made sure not to alter any learning information. Disclaimer inside.

